// Random Library
// Author: Brittni Watkins
function randomFloat(n,o){return Math.random()*(o-n)+n}function randomInt(n,o){let t=randomFloat(n,o);return Math.floor(t)}function randomBoolean(){let n=!0;return randomInt(0,2)%2==0&&(n=!1),n}